import 'antd/dist/antd.css'
import {PropTypes} from 'prop-types'
import React from 'react'

const App = ({Component}) => {
    return (
        <Component />
    )
}

App.propTypes = {
    Component:PropTypes.elemnetType.isRequired,
}
export default App
